const Navigator = () => {
    return (
        <nav>
            <ul>
                <li>Home</li>
            </ul>
            <ul>
                <li>sign-in</li>
            </ul>
        <style>
            {
                `ul li {
                    line-style-type: none;
                }`
            }
        </style>
        </nav>
    )
}

export default Navigator;
